import React from 'react';
import { Container, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const FoodMenu = () => {
    return (
        <Container fluid>
            <Container>
                <Nav className="justify-content-center" activeKey="/home">
                    <Nav.Item>
                        <Link className="" to="/home">Breakfast</Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Link to="link-1">Lunch</Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Link onTouchMove="link-2">Dinner</Link>
                    </Nav.Item>
                </Nav>
            </Container>
        </Container>
    );
};

export default FoodMenu;
